import axios from "axios"
import { getapi } from "../constant"

const GetResource = async()=>{
  let resp;  
  const response = await axios.get(getapi).then(res =>{
      if(res.status==200){
        return res.data.imgData;
      }

  });
  return response;

}
export default GetResource;
